const block3 = (item, index, context) => { return html`<ui5-token				?readonly="${context.readonly}"				class="ui5-multi-combobox-token"				data-ui5-id="${ifDefined(item._id)}"				part="token-${index}"				>					${ifDefined(item.text)}</ui5-token>			`; };
